query WorkerPlacementOverviewQuery(
    $accountTag: string
    $filter: ZoneWorkersRequestsFilter_InputObject
  ) {
    viewer {
      accounts(filter: { accountTag: $accountTag }) {
        workerPlacementAdaptiveGroups(limit: 100, filter: $filter) {
          sum {
            requests
            requestDuration
          }
        }
      }
    }
  }

query WorkerPlacementsQuery(
    $accountTag: string
    $filter: ZoneWorkersRequestsFilter_InputObject
  ) {
    viewer {
      accounts(filter: { accountTag: $accountTag }) {
        workerPlacementAdaptiveGroups(
          limit: 100
          filter: $filter
          orderBy: [requestDurationBucketMin100ms_DESC]
        ) {
          sum {
            requests
            requestDuration
          }
          dimensions {
            isSample
            requestDurationBucketMin100ms
          }
        }
      }
    }
  }

query ZarazActionsSparklinesDataByDate(
    $zoneTag: string
    $start: Date
    $end: Date
  ) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        actions: zarazActionsAdaptiveGroups(
          limit: 10000
          filter: {
            datetimeHour_geq: $start
            datetimeHour_leq: $end
            toolName: $toolId
          }
          orderBy: [datetimeHour_ASC]
        ) {
          count
          dimensions {
            ts: datetimeHour
            name: actionName
          }
        }
      }
    }
  }

