query ZarazAnalyticsFilterOptions(
      $zoneTag: string
      $mainFilter: ZoneZarazAnalyticsTrackAdaptiveGroupsFilter_InputObject!
      $orderBy: [ZoneZarazAnalyticsTrackAdaptiveGroupsOrderBy!]
    ) {
      viewer {
        zones(filter: { zoneTag: $zoneTag }) {
          tracks: zarazAnalyticsTrackAdaptiveGroups(
            limit: 100
            filter: {
              AND: [
                {
                  trackName_notin: ["__zarazEmpty", "__zarazConsentedPageview"]
                }
                { AND: $mainFilter }
              ]
            }
            orderBy: [count_DESC]
          ) @connection(key: ZarazAnalyticsTrackNameOptions) {
            count
            dimensions {
              name: trackName
            }
          }
          urls: zarazAnalyticsTrackAdaptiveGroups(
            limit: 100
            filter: {
              AND: [
                {
                  trackName_notin: ["__zarazEmpty", "__zarazConsentedPageview"]
                }
                { AND: $mainFilter }
              ]
            }
            orderBy: [count_DESC]
          ) @connection(key: ZarazAnalyticsUrlOptions) {
            count
            dimensions {
              name: urlPath
            }
          }
          trafficSources: zarazAnalyticsTrackAdaptiveGroups(
            limit: 100
            filter: {
              AND: [
                {
                  trackName_notin: ["__zarazEmpty", "__zarazConsentedPageview"]
                }
                { AND: $mainFilter }
              ]
            }
            orderBy: [count_DESC]
          ) @connection(key: ZarazAnalyticsTrafficSrcOptions) {
            count
            dimensions {
              name: trafficSrc
            }
          }
          triggers: zarazAnalyticsTriggersAdaptiveGroups(
            limit: 100
            filter: {
              AND: [
                { triggerName_notin: ["Analytics Track"] }
                { AND: $mainFilter }
              ]
            }
            orderBy: [count_DESC]
          ) @connection(key: ZarazAnalyticsTriggerNameOptions) {
            count
            dimensions {
              name: triggerName
            }
          }
        }
      }
    }

