query ZarazAnalyticsOverviewCounters(
      $zoneTag: string
      $filter: zarazAnalyticsTrackAdaptiveGroupsFilter_InputObject!
      $avgSessionTimeFilter: zarazAnalyticsTrackTrafficSourcesAdaptiveGroupsFilter_InputObject!
    ) {
      viewer {
        zones(filter: { zoneTag: $zoneTag }) {
          totalEvents: zarazAnalyticsTrackAdaptiveGroups(
            limit: 1
            filter: {
              AND: [
                { AND: $filter }
