                  trackName_notin: ["__zarazEmpty", "__zarazConsentedPageview"]
                }
              ]
            }
          ) @connection(key: ZarazAnalyticsOverviewReportTotalEventsData) {
            count
          }
          avgSessionTime: zarazAnalyticsTrackTrafficSourcesAdaptiveGroups(
            limit: 1
            filter: { AND: $avgSessionTimeFilter }
