query ZarazAnalyticsPageReport(
      $zoneTag: string
      $limit: uint64!
      $mainFilter: ZoneZarazAnalyticsTrackAdaptiveGroupsFilter_InputObject!
      $orderBy: [ZoneZarazAnalyticsTrackAdaptiveGroupsOrderBy!]
    ) {
      viewer {
        zones(filter: { zoneTag: $zoneTag }) {
          pageviews: zarazAnalyticsOrderedTrackAdaptiveGroups(
            limit: $limit
            filter: { AND: [{ trackName: "Pageview" }, { AND: $mainFilter }] }
            orderBy: [$orderBy]
