            count
            dimensions {
              urlPath
            }
          }
          sessionEnd: zarazAnalyticsOrderedTrackAdaptiveGroups(
            limit: $limit
            filter: {
              AND: [{ reverseOrderInSession: 1 }, { AND: $mainFilter }]
            }
            orderBy: [$orderBy]
          ) @connection(key: ZarazAnalyticsPageReportAsExitPage) {
            count
            dimensions {
              urlPath
            }
          }
        }
      }
    }

